VALUES ('7616500176140', 'pralines du confiseur', 'Assortierte Pralinen — Zutaten: Zucker, Kakaobutter, Kakaomasse, Vollmilchpulver, Haselnüsse, Mandeln, Walnüsse, Butterreinfett, Feuchthaltemittel: Sorbitsirup und E 422, Invertzuckersirup, Palmôl, Glucosesirup, Kokosôl, Magermilchpulver, Sonnenblumenôl, Kirsch, Emulgator: Sojalecithin, Rum, Rôstkaffee gemahlen, Cognac, Kakaopulver, Aromen, Caramelzucker. Kann Gluten, Eier und Spuren anderer Schalenfrüchte (Nüsse) enthalten. Kakao: 33 % mindestens in der Milchschokolade. Kakao: 44 % mindestens in der dunklen Schokolade. Pralinés assortis — Ingrédients.\' sucre, beurre de cacao, pâte de cacao, lait entier en poudre, noisettes, amandes, noix, beurre fondu, humectants: sirop de sorbitol et E 422, sirop de sucre inverti, huile de palme, sirop de glucose, huje de coco, lait écrémé en poudre, huile de tournesol, Kirsch, émulsifiant: lécithine de soja, Rhum, café torréfié moulu, Cognac, cacao en poudre, arômes, sucre caramel. Peut contenir du gluten, des œufs et des traces d\'autres fruits à coque (noix). Cacao: 33 % minimum dans le chocolat au lait. Cacao: 44 % minimum dans le chocolat noir, Praline assortite Ingredienti: zucchero, burro di cacao, pasta di cacao, latte intero in polvere, nocciole, mandorle, nocii burro fuso, agenti umidificanti: sciroppo di sorbitolo ed E 422, sciroppo di zucchero invertito, di palma, sciroppo di glucosio, olio di cocco, latte magro in polvere, olio di girasole, Kirsch, emulsionante: fecitina di soia, Rum, cafe torrefatto macinato, Cognac, cacao in polvere, aromi, caramello. Può contenere uova e tracce d\'altra frutta con guscio (noci). Cacao: 33 % minimo nel cioccolato al latte. Cacao.\' 44 % ninimo net cioccolato amaro.', 'https://static.openfoodfacts.org/images/products/761/650/017/6140/front_fr.4.400.jpg', '35', '18', '50', '47', '3', '6', '0.09', '0.0354330708661417', '', '0');

