VALUES ('7616500662018', 'Mahony corn', 'EI CH: Feine Milchschokolade mit Maisstücken und Honig-Mandel-Nougat DE: Feine Milchschokolade mit Maisstücken und Zutaten: Zucker Kakad butter, Kakaomasse, Vollmilchpulver, Mai 4,5%, Magermilch ler Hon 1.7 % Butter eintett Sonnenblumenöl Mandeln 0.8 %, Emulgator: Sojalec thin Kochsalz, Hühner- eiweisspulver (aus Freilandhaltung), natürliche Aromen, Antioxidationsmittel: Rosmarinextrakt. Kann Haselnüsse und Spuren anderer Schalenfrüchte (Nüsse) enthalten. Kakao: 34 % mindestens in der Schokolade, Nougat/Torrone: 5 % Chocolat au lait fin avec des morceaux de mais et nougat au miel et aux amandes Ingrédients. Sucre, beurre de cacao, pâte de cacao, lait entier en poudre, mais 4,5 %, lait écrémé en poudre, miel 1.7 %, beurre fondu, huile de tournesol, amandes 0.8 %, émulsifiant lécithine de soja, sel de cuisine, blanc d\'oeuf en poudre (d\'élevage en liberté), arômes naturels, antioxydant: extrait de romarin. Peut contenir des noisettes et des traces d\'autres fruits à coque (noix). Cacao: 34 % minimum dans le chocolat. Nougat 5 % ig Cioccolato al latte finissimo con pezzi di granturco e torrone al miele ed alle mandorle Ingredienti: zucchero, burro di cacao, pasta di cacao, latte intero in polvere, granturco 45%, latte magro in polvere, miele 1.7 %, burro fuso, olio di girasole, mandorle 0.8 %, emulsionante: lecitina d soia, sale da cucina, albume in polvere (d\'allevamento all\'aperto), aromi naturali, antiossidante: estratto di rosmarino. Può contenere nocciole e tracce d\'altra frutta con guscio (noci). Cacao: 34 % minimo nel cioccolato. Torrone: 5 %', 'https://static.openfoodfacts.org/images/products/761/650/066/2018/front_fr.14.400.jpg', '31', '18', '57', '52', '2.7', '6.5', '0.29', '0.114173228346457', '', '0');

